Wij brengen kleur in uw leven!
Toner Products Nederland is al sinds 2007 uw betrouwbare leverancier van originele en private label toner- en inktcartridges. Toner Products Nederland heeft als solide familiebedrijf de eerste jaren een zeer respectabele naam opgebouwd bij bedrijven en consumenten. In de afgelopen 2 jaar heeft het bedrijf zich versterkt met een aantal professionals uit de toner- en inktindustrie. Deze versterking heeft voor een nog grotere productkennis en een verdergaande professionalisering van het bedrijf gezorgd. Na uitvoerige tests en vergelijkingen zijn de beste leveranciers met topproducten uit de industrie geselecteerd. U kunt daardoor voortaan uit veel meer producten, en bovendien, bij de meeste producten uit 3 opties kiezen:
 
1. De originele cartridge met een laagste prijs garantie;
2. Het remanufactured TPN huismerk waarmee u gemiddeld 35% bespaart t.o.v. het origineel;
3. Het new built alternatief merk waarmee u gemiddeld 50% bespaart t.o.v. het origineel.
 
Tevens is de website compleet vernieuwd aan de buitenkant maar vooral ook aan de binnenkant. Met deze volledig nieuwe en overzichtelijke website zorgt Toner Products Nederland voor nog meer winkel- en bestelgemak voor u als klant. Zo vindt u sneller en makkelijker wat u zoekt, kunt u deze producten sneller en eenvoudiger bestellen en met de betaalwijze van uw keuze vooraf of achteraf betalen. Uw eigen omgeving binnen de website laat u zien welke printer(s) u heeft en welke cartridges u nodig heeft en wat u in het verleden besteld heeft inclusief uw facturen. Bij vragen wordt u direct telefonisch, per chat of per email geholpen en in onze Veelgestelde Vragen en Blog blijft geen vraag meer onbeantwoord. Via de automatisch toegestuurde Track en Trace gegevens kunt u uw bestelling blijven volgen. Een bestelling die ook op onze nieuwe website Altijd Snel en Gratis thuisbezorgd wordt!

Taylor Rowe are a consultancy providing a dedicated specialist service to occupiers in the retail and leisure market, with a particular focus on restaurants.

We are based in Bristol but offer a nationwide service to occupiers of retail and leisure property. We are experienced and have a comprehensive knowledge of the market in each region and in previous employment have acted for both owners and occupiers. Having experience and knowledge of both occupiers and investors motives allows us to tailor our advice to achieve our client’s desired outcomes. 

Our services include:-
provision of expert advice on rent reviews and lease renewals; 
lease restructuring;
managing applications for consent for alterations, assignment or sub letting; 
general estate management and lease advice; 
and audit and challenge of service charge demands.

We were set up to focus on delivering a service to our clients to cater to their needs rather than delivering a profit by fulfilling the basics of a contract. Our ethos is to form genuine partnerships with our clients, rather than to merely provide a set of contractual services. We work collaboratively and are able to tailor our services to our partners' needs and look to forge long term relationships.
